import { useEffect } from "react";
import { useNavigate, useSearchParams } from "react-router-dom";
import axios from 'axios';
// import qs from 'qs';

const AUTH_SERVER_ADDRESS = "http://localhost:8090"

export default function GetAccessToken(){
    const navigate = useNavigate()
    const [searchParams, setSearchParams] = useSearchParams()

    useEffect(() => {
        const code = searchParams.get("code")
        const client_id = searchParams.get("client_id")
        // const client_id = searchParams.get("code")


        const xWwwformUrlencodedData = {
            grant_type: "authorization_code",
            client_id: client_id,
            redirect_uri: ""

        }

        axios.post(`${AUTH_SERVER_ADDRESS}/realms/LibraryAppRealm/protocol/openid-connect/token`, 
                    {
                        // headers: {Authorization: BEARER_HEADER_PREFIX + access_token}
                    })

        navigate('/')
    }, [navigate]);

}
